import React, { useEffect } from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState([]);

  useEffect(() => {
    fetch("https://api.jikan.moe/v4/anime/38000/characters")
      .then((response) => response.json())
      .then((data) =>
        data.data.map((x) => {
          return setData({
            name: x.character.name,
            img_url: x.character.images.jpg.image_url,
          });
        })
      )
      .catch((err) => console.error(err));
  }, []);

  return <div>{console.log(data)}</div>;
}

export default App;

